import React from 'react';
import classes from './post.module.css';
import content from "../content.module.css";
 const post=()=>
 {
     return(
         <div className={content.blockComment}>
             <div className={content.imgIconsProfile}>

             </div>
             <div className={content.textComment}>
                 <p>Hello, my name is Ivan?</p>
             </div>
         </div>
     );
 }
 export default post();
